Description:
            // Set of Anniversary Traveling With Luggage Tags //

This rustic set of leather luggage tags is a unique and romantic way to decorate your luggage as you embark on an adventure together with your loved one.  

Engraved with your choice of names and date, the handcrafted 9x4 cm (about 3.5x1.5 inch) tags can be mounted on any suitcase and proudly display to the world that you are travelling together through life.

// HOW TO ORDER //
Ordering is easy. Just click the “Add to cart” button and let me know in the field “Add an optional note to seller” which names and year I should engrave on your luggage tags! The price is for a set of two tags.

Please allow up to 5 business days for me to make your luggage tags by hand in my workshop.
